Doctor Adventures Vol. 12 (DvdRip)

Avy Scott, Chris Johnson, Diamond Foxxx, Eva Karera, Gina Lynn, James Deen, Jenaveve Jolie, Jordan Ash, Kieran Lee, Rachel Starr, Shyla Stylez

&quot;Eye Will Fuck You&quot;
Optometrist Gina tries some extra special tests to determine if Keiran is faking his blindness to get workman's compensation. She is willing to help him out with his little scam if he helps her out with a dose of deep dicking!
&quot;Blind, Deaf and Cum&quot;
James brings his girlfriend to the hospital after she mysteriously goes blind, deaf and mute. Dr. Jolie's diagnosis is that it's a rare case of &quot;shock-gasm&quot;, a state of shock that only occurs when the female undergoes the rawest, nastiest sex.
&quot;Got an Itch for Some Hot Scratch&quot;
Keiran sees Dr. Stylez to take a look at his itchy skin. Dr. Stylez tries an experimental treatment: rubbing her big, hot PhD titties on the affected area. Turns out that Keiran's got another itch that needs some scratchin'!
&quot;Dr. Fuck-A-Lot&quot;
Dr. Fuck-a-lot is back at it again, this time he is on duty with Nurse Starr and Scott. They just can not waste the chance that arises when their operation procedure ends earlier than scheduled.
&quot;The Doc Pop&quot;
After months of trying to have a baby, Diamond is ready to talk to an expert. Dr. Johnson is a pro, and he'll do everything he can to help Diamond, and if that means giving her a good old fashioned creampie, then so be it.

